import React from 'react';
import "../../css/About.css"

export default function About() {

  return (

    <div id="about-container">

      <h1 id="title">About Me</h1>

      <div id="about">

          <p>I'm a 22 year old Web Developer from Charlotte, NC.</p>
          <p>I have been building eCommerce stores with tools like Shopify, WordPress, and Webflow for 4 years.</p>
          <p>I recently completed the Coding Bootcamp At UNCC, and look to join a team where I will have a chance to continue sharpening my skills programming throughout the stack.</p>
          <p>When I'm not working, you can find me fishing, making beats, gardening, or hanging out with my dog, Deuce!</p>

      </div>

    </div>

  );
}
